class Solution:
#runtime n passed
    def largestRectangleArea(self, heights: List[int]) -> int:
        self.heights = heights
        n = len(heights)
        left_limit = [0]*n
        stack = []
        for i in range(n):
            while stack:
                elem_index = stack.pop()
                if heights[elem_index] < heights[i]:
                    stack.append(elem_index)
                    left_limit[i] = elem_index+1
                    break
            else:
                left_limit[i]=0
            stack.append(i)
        
        right_limit = [0]*n
        stack = []
        for i in range(n)[::-1]:
            while stack:
                elem_index = stack.pop()
                if heights[elem_index] < heights[i]:
                    stack.append(elem_index)
                    right_limit[i] = elem_index-1
                    break
            else:
                right_limit[i]=n-1
            stack.append(i)
        area = [0]*n
        for i in range(n):
            area[i] = (right_limit[i]-left_limit[i]+1)*heights[i]
        return max(area)




#time limit exceded runtime n^2 pass 87 / 96
    def largestRectangleArea_1(self, heights: List[int]) -> int:
        self.heights = heights
        n = len(heights)
        largest_rect = 0
        for i in range(n):
            for j in range(i,n):
                largest_rect = max(largest_rect,self.get_min(i,j)*(j-i+1))
        return largest_rect

    @lru_cache(None)
    def get_min(self,l,r):
        if l==r:
            return self.heights[l]
        return min(self.get_min(l,r-1),self.heights[r])


